					ledSubareaHolder.Enter += new EventHandler(this.newHolder_Enter);
					ledSubareaHolder.HolderEvent += new LedGlobal.LedContentEvent(this.newHolder_HolderEvent);
					ledSubareaHolder.Redraw();
