			this.subareaEffectSetting.Enabled = true;
			this.marqueDeleteButton.Enabled = true;
			this.marqueeEdit.Enabled = true;
			this.marqueeConentUp.Enabled = true;
			this.marqueeConentDown.Enabled = true;
