		public static IList<LedItem> SortIList(IList<LedItem> pList, int pIndex, bool pUp)
		{
			if (pIndex == 0 && pUp)
			{
				return pList;
			}
			if (pIndex == pList.Count - 1 && !pUp)
			{
				return pList;
			}
			int index;
			if (pUp)
			{
				index = pIndex - 1;
			}
			else
			{
				index = pIndex + 1;
			}
			LedItem value = pList[index];
			pList[index] = pList[pIndex];
			pList[pIndex] = value;
			return pList;
		}

