						e.Graphics.DrawImage(ledEdgeList[index], new System.Drawing.Rectangle(bounds.Left, bounds.Top + bounds.Height / 2 - height, 64, height * 2 + 1), new System.Drawing.Rectangle(0, 0, 32, height), srcUnit);
