			System.Drawing.Color[] tricolorList = LedColorConst.TricolorList;
			for (int i = 0; i < tricolorList.Length; i++)
			{
				if (LedGraphics.EqualsColor(pColor, tricolorList[i]))
				{
					result = i;
					break;
				}
