		private void dialConnerTextTextBox_SelectedIndexChanged(object sender, EventArgs e)
		{
			ComboBox comboBox = (ComboBox)sender;
			if (!comboBox.Focused)
			{
				return;
			}
			string[] array = comboBox.Text.Split(new char[]
			{
				','
			});
			if (array.Length < 4)
			{
				return;
